import React, { useEffect, useState } from 'react';
import { useFinance } from '../context/FinanceContext';
import { Line, Pie } from 'react-chartjs-2';
import { Chart as ChartJS } from 'chart.js/auto';

const Dashboard = () => {
  const { transactions } = useFinance();  // Get transactions from context
  const [totalIncome, setTotalIncome] = useState(0);
  const [totalExpenses, setTotalExpenses] = useState(0);
  const [remainingBudget, setRemainingBudget] = useState(0);
  const [savings, setSavings] = useState(0);
  const [monthlyData, setMonthlyData] = useState([]);
  const [categoryData, setCategoryData] = useState([]);

  useEffect(() => {
    let income = 0;
    let expenses = 0;
    let categoryExpenses = {};

    transactions.forEach(transaction => {
      if (transaction.type === 'income') {
        income += transaction.amount;
      } else {
        expenses += transaction.amount;
        categoryExpenses[transaction.category] = (categoryExpenses[transaction.category] || 0) + transaction.amount;
      }
    });

    setTotalIncome(income);
    setTotalExpenses(expenses);
    setRemainingBudget(income - expenses);
    setSavings(income - expenses);

    setCategoryData(Object.entries(categoryExpenses).map(([category, amount]) => ({
      label: category,
      value: amount,
    })));

    setMonthlyData([
      { month: 'January', amount: 300 },
      { month: 'February', amount: 200 },
      { month: 'March', amount: 400 },
      { month: 'April', amount: 350 },
    ]);
  }, [transactions]);

  // Chart Data
  const pieData = {
    labels: categoryData.map(item => item.label),
    datasets: [{
      data: categoryData.map(item => item.value),
      backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0'],
    }],
  };

  const lineData = {
    labels: monthlyData.map(item => item.month),
    datasets: [{
      label: 'Monthly Spending',
      data: monthlyData.map(item => item.amount),
      borderColor: '#36A2EB',
      fill: false,
    }],
  };

  return (
    <div>
      <h2>Dashboard</h2>
      <div className="row">
        <div className="col-md-3">
          <div className="card">
            <div className="card-body">
              <h5>Total Income</h5>
              <p>${totalIncome}</p>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card">
            <div className="card-body">
              <h5>Total Expenses</h5>
              <p>${totalExpenses}</p>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card">
            <div className="card-body">
              <h5>Remaining Budget</h5>
              <p>${remainingBudget}</p>
            </div>
          </div>
        </div>
        <div className="col-md-3">
          <div className="card">
            <div className="card-body">
              <h5>Savings</h5>
              <p>${savings}</p>
            </div>
          </div>
        </div>
      </div>

      <div className="row mt-4">
        <div className="col-md-6">
          <h5>Monthly Spending Trends</h5>
          <Line data={lineData} />
        </div>
        <div className="col-md-6">
          <h5>Category-wise Expense Breakdown</h5>
          <Pie data={pieData} />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
